    const getTime = f => {
      const match = f.match(/frame(?:_result)?_(\d+)\.jpg/);
      return match ? parseInt(match[1]) : 0;
    };
    return getTime(a) - getTime(b);
  });

  const fullData = sorted.map(name => {
    const match = name.match(/frame(?:_result)?_(\d+)\.jpg/);
    return {
      name,
      url: `http://220.149.235.221:4000/images_result/${name}`,
      timestamp: match ? parseInt(match[1]) : 0
    };
  });
}
